import React, { useEffect } from 'react';
import axios from 'axios';

const GetImage = () => {
  useEffect(async () => {
    var images = await axios.get('/api/users/image_upload');
  });
  return (
    images &&
    images.map((image) => (
      <div>
        <img src={image.data} />
      </div>
    ))
  );
};

export default GetImage;
